  handleResize(){
    if(window.innerWidth != this.state.screenWidth){
      if(window.innerWidth > 1600){
        tableWidthLarge = 9
        tableWidthSmall = 3
        this.setState({ smallScreenSize: false, width: 430, widthSafety: 460, widthHR: 460, widthHRPadding: '4.3%',  height: 400, screenWidth: window.innerWidth})
        window.location.reload()
      }else if(window.innerWidth > 1200 && window.innerWidth <= 1600){
        tableWidthLarge = 9
        tableWidthSmall = 3
        this.setState({ smallScreenSize: false, width: 340, widthSafety: 345, widthHR: 345, height: 350, screenWidth: window.innerWidth})
        window.location.reload()
      }else if(window.innerWidth >= 1024 && window.innerWidth <= 1200){
        tableWidthLarge = 12
        tableWidthSmall = 12
        this.setState({ smallScreenSize: true, width: 900, height: 600, screenWidth: window.innerWidth})
        window.location.reload()
      }else if(window.innerWidth >= 768 && window.innerWidth < 1024){
        //ipad size
        tableWidthLarge = 12
        tableWidthSmall = 12
        this.setState({ smallScreenSize: true, width: 700, height: 550, screenWidth: window.innerWidth})
        window.location.reload()
      }else if(window.innerWidth < 768){
        this.setState({ smallScreenSize: true, width: 390, height: 350, screenWidth: window.innerWidth})
        window.location.reload()
      }
    }
  }

