componentWillUnmount() {
  // you need to unbind the same listener that was binded.
  window.removeEventListener('resize', this.handleResize, { passive: true });
}

renderTableDataModel() {
  return this.state.students.map((student, index) => {
     const { financial, projected, YTD, V, avg, current_month, previous_month } = student //destructuring
     return (
        <tr key={financial}>
           <td>{financial}</td>
           <td>{projected}</td>
           <td>{YTD}</td>
           <td>{V}</td>
           <td>{current_month}</td>
           <td>{avg}</td>
           <td>{previous_month}</td>
        </tr>
     )
  })
}

renderTableHeaderModel() {
  let header = Object.keys(this.state.students[0])
  return header.map((key, index) => {
     var headerValue = key
     if(headerValue === "previous_month"){
       headerValue = "previous month"
     }else if(headerValue === "current_month"){
       headerValue = "current month"
     }
     return <th key={index}>{headerValue.toUpperCase()}</th>
  })
}

onRowClick = (state, rowInfo, column, instance) => {
  return {
      onClick: e => {
          console.log('A Td Element was clicked!')
          console.log('it produced this event:', e)
          console.log('It was in this column:', column)
          console.log('It was in this row:', rowInfo)
          console.log('It was in this table instance:', instance)
      }
  }
}

getTrProps = (state, rowInfo, instance) => {
  if (rowInfo) {
    //console.log(rowInfo)
    return {
      style: {
        borderBottom: rowInfo
          ? rowInfo.row.name === '31-60' || rowInfo.row.name === 'Current' || rowInfo.row.name !== '90+'
            ? "solid .5px grey"
            : "none"
          : "none",
        borderTop: rowInfo
          ? rowInfo.row.name === 'Total'
            ? "solid 3px grey"
            : "none"
          : "none"

      }
    };
  }
  return {};
};

getTrPropsRevenue = (state, rowInfo, instance) => {
  if (rowInfo) {
    console.log(rowInfo)
    return {
      style: {
        borderRight: rowInfo
          ? (rowInfo.original.financial === 'NOI' && instance.id === 'financial') || (rowInfo.original.financial === 'NOI %' && instance.id === 'financial') || (rowInfo.original.financial === 'Revenue' && instance.id === 'financial') || (rowInfo.original.financial === 'Gross Margin' && instance.id === 'financial') || (rowInfo.original.financial === 'Gross Margin % ' && instance.id === 'financial') || (rowInfo.original.financial === 'G & A %' && instance.id === 'financial') || (rowInfo.original.financial === 'G & A' && instance.id === 'financial')
            ? "solid 3px grey"
            : "none"
          : "none",
        borderTop: rowInfo
          ? rowInfo.row.financial === 'NOI' || rowInfo.row.financial === 'Revenue'
            ? "solid 3px grey"
            : "none"
          : "none"  
      }
    };
  }
  return {};
};

